import React from "react";
import { price } from "../../dummydata";

const PriceCard = () => {
  return (
    <>
      {price.map((val, index) => (
        <div key={index} className='items shadow'>
          <h4>{val.name}</h4>
          <h1>
          {val.price === "49K" ? (
               <i className="fas fa-lock"></i> 
            ) : (
              val.price
            )}
          </h1>
          <p>{val.desc}</p>
          <button className='outline-btn'>LEARN MORE</button>
        </div>
      ))}
    </>
  );
};

export default PriceCard;
